import React, { Component } from "react";
import "./estilos.css";

import 'bootstrap/dist/css/bootstrap.min.css';

import { findFlagUrlByNationality } from "country-flags-svg";

//https://www.npmjs.com/package/country-flags-svg

class Bandeiras extends Component{
    constructor(props){
        super(props)
    }

    render(){
        console.log('estou no bandeiras e as props são',this.props)
        return(
            <section className='cb'>
            <ul>
                {this.props.bandeirasInicio.map((b,index)=>{
                    return(
                        <li key={'band'+index}>
                            <button className="btn btn-primary">{b}</button>
                        </li>
                    )
                })}
            </ul>
            </section>
        )
    }
}

export default Bandeiras;
